CDIÀ propos
Fondé en 1999 par 3 pionniers de l'Internet français qui souhaitent que l'enregistrement de noms de domaine ne soit pas uniquement géré par quelques grands acteurs américains, Gandi devient en 2000 le premier bureau d'enregistrement français accrédité par l'ICANN. Depuis, l'aventure se poursuit avec toujours la même volonté d'indépendance.
Offrir une alternative indépendante aux internautes, défendre la vie privée de ses clients, soutenir des projets opensource fait partie de l'ADN de l'entreprise, qui s'affiche comme "No Bullshit" et s'affranchit des codes et des méthodes traditionnels.
Chez Gandi, la croissance est organique, uniquement basée sur le bouche à oreille : pas de publicité, pas d'emailing promotionnels, pas de fausses promesses. C'est la qualité de service, garantie par un service client interne et des salariés mobilisés, et la transparence qui ont permis à l'entreprise de devenir en 15 ans l'un des plus gros vendeurs de noms de domaine dans le monde.

Descriptif du poste
Développeur(euse) Système
Ton quotidien :
Tu aides à améliorer les offres de produits d'hébergement ;
Tu participes au design et au développement des produits IaaS/PaaS, aux solutions de stockage ;
Tu participes activement à optimiser notre hébergement en terme de rapidité, de scalabilité, de résiliance et de tout ce que tu peux trouver d'améliorable ;
Tu participes aux modifications et aux évolutions de la plateforme au coeur de notre infrastructure ;
Profil recherché
Tu veux venir ?
Tes atouts :
Tu parles couramment français et l'anglais technique est ta seconde langue ;
Tu connais Linux, FreeBSD, idéalement python et peut-être même C sous toutes ses déclinaisons ;
Tu connais la virtualisation (Xen chez nous), les containers (LXC, cgroups, jails, namespaces), le tracing (dtrace, systemtap, perf, procstat) ;
Quand on te dit x86_64, binaries, linker/loader, ELF, POSIX...tu sais exactement de quoi on parle ;
Tu aime débugger des problèmes complexes ;
Tu communiques sans problème avec les autres équipes même celles qui sont en remote ;
Tu as un véritable attachement aux libertés sur Internet et aux logiciels libres ;
Pourquoi Gandi ?
T'investir dans une entreprise avec une culture forte et un environnement accueillant ;
Participer à l'entretien d'un petit bout d'Internet ;
Travailler avec des technologies innovantes et une méthodologie agile ;
Relever des défis interessants avec des collègues qualifiés ;
Les Tickets Restaurants sur une base 60/40 ;
Du café, beaucoup de café, des boissons gazeuses à volonté, des fruits tous les mardis et des viennoiseries le vendredi ;
Laptop et double écrans de fonction ;
Collègues survivalistes à foison, survie assurée en cas d'apocalypse nucléaire/zombie.
Alors tente l'aventure et rejoins-nous pour participer au développement d'une entreprise où Internet est le coeur de métier.

