Descriptif du poste
Développeur backend python
Tu participes aux développements de nouvelles fonctionnalités liées aux produits Gandi, en étroite collaboration avec les différents métiers du Nom de Domaine, au sein d'une équipe en mode "squads"
Tes missions :
Tu prends en main les projets depuis les specs jusqu'à la production du code ;
Tu produits un code clair, robuste et réutilisable par les autres ;
Tu sais optimiser ta production en termes de fluidité et de rapidité d'usage ;
Tu es en capacité d'identifier et de prendre en considération les implications de ton code en matière de stockage d'infomations et de bases de données
Tu participes aux évolutions de la stack en étant force de proposition.
Profil recherché
Rejoints nos équipes de Développeurs Backend
Tes atouts :
Tu jongles entre l'anglais, le français et le python ;
Tu es ouvert, empathique et sais travailler en équipe y compris avec des non développeurs ;
Tu as des connaissances en XMLRPC/REST API, voire si on te dit EPP tu sais précisément de quoi on parle ;
Tu es donc incollable sur le DNS ;
Tu pratiques l'intégration continue, le déploiement et les tests unitaires et fonctionnels.
La liberté de l'internet et l'open source raisonnent en toi. Alors tente l'aventure et rejoins l'un des acteurs majeur et authentique du web en France !

50 000 € par anCDISql-server / Dynamics-crm / .net / Bigdata / C#
Full Stack / CDI / Environ 50k€ / 2 - 5 ans / Paris

Le poste
Dans un contexte global de transformation digitale de la Société, vous rejoignez le département informatique dans le cadre d’une création de poste. Ce dernier est composé d’une dizaine de personnes actuellement (internes et prestataires). Votre mission principale, au départ, sera d’internaliser l’expertise et la dimension « technique » de Microsoft Dynamics 365 (le déploiement ayant été assuré par un prestataire).

Les responsabilités
Vous comprenez dans un premier temps l’activité de la société et les besoins des différents métiers ;
Vous traduisez ces derniers afin de configurer et paramétrer au mieux la solution Dynamics 365 (notamment le CRM) ;
Vous participez à des développements « custom » ;
Vous êtes en charge de la partie bases de données (SQL Server, Power BI, Data Warehouse…) ;
Vous êtes force de proposition et êtes capable de challenger les métiers au quotidien...
Pourquoi venir chez nous?
- création de poste - poste varié et transversal - Acteur reconnu de la gestion de patrimoine - superbes locaux - entreprise à taille humaine
